    highest_divisor = None

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    for i in range(2, n + 1):
        if n % i == 0:
            if is_prime(i):
                highest_prime = i
            if i != n:
                highest_divisor = i

    if highest_prime is None:
        return []

    return [highest_prime, highest_divisor] if highest_divisor is not None else [highest_prime, highest_prime]
